import React from "react";
import web from "./img/spain.png";

const Home = () => {
  return (
    <>
      <section id="header_section mt-5">
        <div class="container-fluid">
          <div className="row d-flex align-items-center justify-content-around">
            <div className="col-4">
              <h1>
                Grow your business with{" "}
                <strong className="text-primary">Thapa Technical</strong>
              </h1>
              <p>we are the team of talented developer making websites</p>
              <button className="btn btn-outline-primary btn_get_started">
                get started
              </button>
            </div>
            <div className="col-4 header_image order-1">
              <img src={web} className="img-fluid animated" />
            </div>
          </div>
        </div>
      </section>
    </>
  );
};
export default Home;
